import React from 'react';
import './App.css';

function App() {
  const empleado = {
    nombre: 'Alan',
    trabajo: 'Desarrollador'
  }
  return (
    <div>
      <h1 class="mayusculas" >Aprendiendo React</h1>
      <p>Hola {empleado.nombre}</p>
      <p>{empleado.trabajo}</p>
    </div>
  );
}

export default App;
